  function refreshChild(child, parent, eventId) {
    var assetData;

    switch (parent) {
      case "end-card": {
        assetData = window.editorParams.endCardAssetData.find((asset) => asset.id === child.id);
        break;
      }
      case "event": {
        const currentEventData = playableEvents.find((event) => event.id === eventId)

        if (currentEventData) {
          assetData = currentEventData.eventAssets.find((asset) => asset.id === child.id)
        }
        break;
      }
      default:
        assetData = window.editorParams.nonInteractiveAssetData.find((asset) => asset.id === child.id)
        break;
    }

    if (assetData && assetData.type === "text") {
      const text = document.getElementById(assetData.id).children[0].children[1]
      text.style.fontSize = `${Math.round(assetData.font.fontSize * videoWidth)}px`;
    }
  }

  function refreshAssetsView() {
    const endCardAssetWrapper = document.getElementById("end-card-wrapper");
    const noninteractiveAssetWrapper = document.getElementById("noninteractive-asset-wrapper");
    const eventAssetWrapper = document.getElementById("playable-asset-wrapper")

    for (const child of endCardAssetWrapper.children) {
      refreshChild(child, "end-card", "");
    }

    for (const child of noninteractiveAssetWrapper.children) {
      refreshChild(child, "", "");
    }

    for (const child of eventAssetWrapper.children) {
      const eventId = child.id.slice(15)

      for (const asset of child.children) {
        refreshChild(asset, "event", eventId)
      }
    }
  }

    endCard.style.display = "none";   

    window.addEventListener("resize", (event) => {
      setPlayableSize();
      refreshAssetsView();
    });

    window.oncontextmenu = function(event) {
      event.preventDefault();
      event.stopPropagation();
      return false;
    };

    timer = setInterval(update, intervalTime);
  }

  video.addEventListener("loadeddata", () => {

    function activateAssetClickArea(asset) {
      const clickAreaWrapper = document.getElementById("click-area-wrapper");
      const clickArea = document.createElement("div");

      clickArea.setAttribute("id", `click-redirection-${asset.id}`);
      clickArea.style.position = "absolute";
      clickArea.style.width = `${asset.size.width}%`;
      clickArea.style.height = `${asset.size.height}%`;
      clickArea.style.left = `${asset.coordinates.x}%`;
      clickArea.style.top = `${asset.coordinates.y}%`;
      clickArea.style.zIndex = 20;

      clickArea.addEventListener("click", () => {
        handleMarketRedirect();
      })

      clickAreaWrapper.appendChild(clickArea);
    }

    function activateClickArea(event) {
      const { type, id } = event;
      const clickAreaWrapper = document.getElementById("click-area-wrapper");
      const clickArea = document.createElement("div")
      clickArea.setAttribute("id", event.id);
      clickArea.style.position = "absolute";
      clickArea.style.zIndex = 10;

      if (!event.enableClickArea) {
        clickArea.style.width = "100%";
        clickArea.style.height = "100%";
        clickArea.style.left = 0;
        clickArea.style.top = 0;  
      } else {
        clickArea.style.width = `${event.clickArea.width}%`;
        clickArea.style.height = `${event.clickArea.height}%`;
        clickArea.style.left = `${event.clickArea.x}%`;
        clickArea.style.top = `${event.clickArea.y}%`;
      }

      clickAreaWrapper.appendChild(clickArea);

          clickArea.addEventListener("touchstart", (event) =>{          
            eventHandler(event, type, id)
        });

          clickArea.addEventListener("touchend", (event) =>
            eventHandler(event, type, id)
          );

          clickArea.addEventListener("mouseup", (event) =>{          
            eventHandler(event, type, id)
        });

          clickArea.addEventListener("mousedown", (event) =>
            eventHandler(event, type, id)
          );

          clickArea.addEventListener("click", (event) =>{          
            eventHandler(event, type, id)
            }
          );
    }

    function eventHandler(event, type, id) {
         if (type === "hold") {
        if (event.type === "touchstart"  || event.type === "mousedown") {
          startHold();
        } else if (event.type === "touchend" || event.type === "mouseup") {
          stopHold();
        }
      } else {
        if (event.type === 'click') {
          deactivatePlayableEvent(id);
        }
      }
      // }
    }

    function deactivatePlayableEvent(id) {
      if (playableId !== "") {
        const clickArea = document.getElementById(id);
        if(clickArea) {
           clickArea.removeEventListener("click", (event) => {
            eventHandler(event, type, id)}
          );
        }
        const playableEvent = playableEvents.find(event => event.id === playableId);
          video.play();
        const clickAreaWrapper = document.getElementById("click-area-wrapper");
        clickAreaWrapper.innerHTML = ""; // clear click area

        switch (eventType) {
          case "freeze":
            break;
          case "loop":
            if (typeof currentLoopFrame === "undefined") {
              cancelAnimationFrame(animationFrame)
              video.currentTime = eventStartTime + eventDuration;
            } else {
              videoWrapper.appendChild(video);
              videoWrapper.removeChild(currentLoopFrame);
            }
            break;
          case "hold":
            break;
        }

        if (playableEvent.enableStoreRedirection) {
          handleMarketRedirect();
        }
        
        if (isEnableSoundEffect) {
          playSoundEffect(playableId)
        }

        deactivateEventAssets(playableId);
        playableEvents.splice(0, 1);
        playableId = "";
        isEnableSoundEffect = false;

        if (false && !isEnabledVideoSound && isEnableSound) {
          video.muted = false;
          isEnabledVideoSound = true;
        }

        if (false && !isEnabledBackgroundMusic && isEnableSound) {
          backgroundMusic.play();
          isEnabledBackgroundMusic = true;
        }
      }
    }

    function playSoundEffect(id) {
      const soundEffect = document.getElementById("event-sound-effect-" + id);
      const playableEvent = playableEvents.find(event => event.id === id);

      soundEffect.src = window.editorParams.base64SoundList[playableEvent.soundEffect.base64SoundIndex];
      soundEffect.volume = playableEvent.soundEffect.volume / 100;

      soundEffect.play();
    }

    // function to update screen frame 
    function checkEventFrame(eventStartTime, currentTime) {
      let eventFrame = Math.round(eventStartTime / (VIDEO_FPS / 1000));
      let videoFrame = Math.round(currentTime / (VIDEO_FPS / 1000))
      return eventFrame === videoFrame;
    }

    function update() {
      const currentTime = video.currentTime;

      if (currentTime === video.duration) {
        enableEndCard();
      }
      
      for (const [index, asset] of window.editorParams.nonInteractiveAssetData.entries()) {
        if (!asset.activated) {
          if (!asset.displaying && currentTime >= asset.startTime && currentTime <= asset.startTime + asset.duration) {
            activateNonInteractiveAsset(index, asset);
            window.editorParams.nonInteractiveAssetData[index].displaying = true;
          } else if (currentTime > asset.startTime + asset.duration) {
            window.editorParams.nonInteractiveAssetData[index].activated = true;
            deactivateNonInteractiveAsset(asset);
          }
        }
      }

      if (playableId === "") {
        for (const [index, event] of playableEvents.entries()) {
          if (checkEventFrame(event.startTime, currentTime)) {
            playableId = event.id;
            window.editorParams[event.type + "Data"][event.index].activated = true;
            video.pause();

            eventStartTime = event.startTime;
            eventDuration = event.duration;     
            eventAssets = event.eventAssets;
            isEnableSoundEffect = event.soundEffect.enableSoundEffect;
            soundEffectVolume = event.soundEffect.effectVolume;
            
            activateEventAssets();
            activateClickArea(event);

            switch (event.type) {
              case "freeze":
                fireFreezeEvent(event, currentTime);
                break;
              case "loop":
                fireLoopEvent(event, currentTime);
                break;
              case "hold":
                fireHoldEvent(event, currentTime);
                break;
            }
            break;
          }
        }
      } else {
        if (eventType === "loop" && !isInitializingLoop) {
          if(window.innerHeight > window.innerWidth) {
            if (frames_portrait[++i]) {
              currentLoopFrame.replaceWith(frames_portrait[i]);
              currentLoopFrame = frames_portrait[i];
            } else {
              frames_portrait.reverse();
              i = 0;
            }
          } else {
            if (frames_landscape[++i]) {
              currentLoopFrame.replaceWith(frames_landscape[i]);
              currentLoopFrame = frames_landscape[i];
            } else {
              frames_landscape.reverse();
              i = 0;
            }
          }
        }
      }
    }

    
function fireLoopEvent(event, videoCurrentTime) {
  video.play();
  eventType = "loop";

  initLoopEvent(event)        
}

function captureVideoFrames() {
  if (video.currentTime >= eventStartTime + eventDuration) {
    isInitializingLoop = false;
    videoWrapper.removeChild(video);
    video.pause();

    frames_portrait.shift();
    frames_portrait.reverse();
    frames_landscape.shift();
    frames_landscape.reverse();

    
    currentLoopFrame = frames_portrait[0];
    videoWrapper.appendChild(currentLoopFrame);
    return;
  }
  
  var newTime = new Date();
  if (newTime - prevTime >= intervalTime) {
    frames_portrait.push(copy().portrait);
    frames_landscape.push(copy().landscape);

    prevTime = newTime
  }

  animationFrame = requestAnimationFrame(captureVideoFrames)
}

function initLoopEvent(event) {
  isInitializingLoop = true;
  frames_portrait = [];
  frames_landscape = [];
  
  captureVideoFrames();
}

function copy() {
  const c_portrait = document.createElement("canvas");
  const c_landscape = document.createElement("canvas");
  var portrait_Width = orientation === 'portrait' ? video.offsetWidth : window.innerHeight; 
  var portrait_Height = orientation === 'portrait' ? video.offsetHeight : window.innerHeight * 16/9;
  var landscape_Width = orientation === 'portrait' ? video.offsetWidth * 9/16 : window.innerHeight * 9/16; 
  var landscape_Height = orientation === 'portrait' ? video.offsetWidth : window.innerHeight;

  Object.assign(c_portrait, {
    width:portrait_Width, 
    height: portrait_Height,
  });

  Object.assign(c_landscape, {
    height: landscape_Height,
    width:landscape_Width,
  });

  c_portrait.getContext("2d").drawImage(video, 0, 0, portrait_Width, portrait_Height);
  c_landscape.getContext("2d").drawImage(video, 0, 0,landscape_Width, landscape_Height);
  return {portrait: c_portrait, landscape: c_landscape};
};

    
function startHold() {
  video.play();

  holdTimer = setInterval(() => {

    if (video.currentTime >= eventStartTime + eventDuration) {
      video.play();
      deactivatePlayableEvent();
      clearInterval(holdTimer);
    }
  }, intervalTime);
}

function stopHold() {
  clearInterval(holdTimer);
  if (video.currentTime < eventStartTime + eventDuration) {
    video.pause();
  }
}

function fireHoldEvent(event, currentTime) {
  eventType = "hold";
  video.pause();
}

    
function fireFreezeEvent(event, currentTime) {
  eventType = "freeze";
  video.pause();
}

      //       }
      //     } else {
      //       pauseVideo();
      //     }
      //   }
      
      function updateprops(event) {
        var gcp = mraid.getCurrentPosition();
        var gss = mraid.getScreenSize();
        var orient = "Undefined!";
        if (window.innerHeight > window.innerWidth) {
          orient= "portrait";
        } else {
          orient = "landscape";
        }
        logmessage(
          "[Cur: x: " + gcp.x + ", y: " + gcp.y + ", width: " + gcp.width + ", height: " + gcp.height + "] [" + "Window: x: " + window.innerWidth + ", y: " + window.innerHeight + "] [" + "Scr: width: " + gss.width + ", height: " + gss.height + "] [" + "Current orientation: " + orient + "] [" + "State: " + mraid.getState() + "] [" + "Last Event: " + event + "]"
        );
      }

      function getStoreUrl() {
        if(MRAID.ios || MRAID.safari) {
          return window.editorParams.marketLink.appStore; 
        } else {
          return window.editorParams.marketLink.googlePlay;
        }
      }
      
      
      function handleMarketRedirect() {
        isEndcardClick = true; 
        mraid.open(getStoreUrl());
      }
      
      window.addEventListener("orientationchange", orientationchange, false);
      
      if (document.readyState == "complete") {
        readycheck();
      } else {
        window.addEventListener("load", readycheck); //DOM and MRAID check
      }

      function muteEventSoundEffect() {
        const audioWrapper = $("audio-wrapper");
      
        for (const child of audioWrapper.children) {
          child.muted = true;
        }
      }
      
      function soundOff () {
        var videle = $('main-video');
        var bgMusic = $('background-music');
        if(bgMusic) {
          bgMusic.muted = true;
        }
        videle.muted = true;
        muteEventSoundEffect();
      }
      
      function soundOn () {
        var videle = $('main-video');
        var bgMusic = $('background-music');
        if(bgMusic) {
          bgMusic.muted = false;
        }  
        videle.muted = false;
      }
      
      function pauseVideo() {
        var videle = $('main-video');
        videle.pause();
        var bgMusic = $('background-music');
        if(bgMusic) {
          bgMusic.muted = true;
        }  
        isPause = true;
      }
    </script>
    
  </body>
</html>
